I wanted to do something different for Pride month. My lovely people with BC2M, The Trevor Project, myself, and Tia Dole put together a different way of allowing the youth of the LGBTQ+ community a platform to just talk in a safe space. Today, my platform is for Grant, Kayla, and April. Full video will be in the link in my bio. 
@aprul_april 
@grantsvenable 
@kayla.kitchen 
You guys are incredible. Thank you for your time, your bravery, and how insanely intelligent you all were. The future of our society lives within the youth of the world. 
Trevor Project Hotline: 1-866-488-7386

